// src/pages/BookingPage.js
// eslint-disable-next-line no-unused-vars
import { GoogleMap, LoadScript } from '@react-google-maps/api';
import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import './BookingPage.css'; // Assuming the corresponding CSS file exists

const BookingPage = () => {
  const { register, handleSubmit, formState: { errors } } = useForm();
  const [location, setLocation] = useState(null);
  const [pickup, setPickup] = useState('');
  const [destination, setDestination] = useState('');

  const onSubmit = data => {
    console.log(data); // handle form submission logic here
  };

  const handlePickupChange = (e) => {
    setPickup(e.target.value);
  };

  const handleDestinationChange = (e) => {
    setDestination(e.target.value);
  };

  return (
    <div className="booking-page">
      <h1>Book Your Car Rescue Service</h1>
      <form onSubmit={handleSubmit(onSubmit)} className="booking-form">
        <div className="form-group">
          <label htmlFor="pickup">Pickup Location</label>
          <input
            type="text"
            id="pickup"
            value={pickup}
            onChange={handlePickupChange}
            {...register('pickup', { required: 'Pickup location is required' })}
          />
          {errors.pickup && <p className="error">{errors.pickup.message}</p>}
        </div>
        
        <div className="form-group">
          <label htmlFor="destination">Destination Location</label>
          <input
            type="text"
            id="destination"
            value={destination}
            onChange={handleDestinationChange}
            {...register('destination', { required: 'Destination location is required' })}
          />
          {errors.destination && <p className="error">{errors.destination.message}</p>}
        </div>

        {/* Map Container */}
        <div className="map-container">
          <LoadScript googleMapsApiKey="AIzaSyBoyZ1H81_TBDC_m0I8gyGykfLfRN5IdFY">
            <GoogleMap
              mapContainerStyle={{ height: "400px", width: "100%" }}
              center={{ lat: 37.7749, lng: -122.4194 }} // Example location
              zoom={12}
            >
              {/* Optional markers or map elements */}
            </GoogleMap>
          </LoadScript>
        </div>

        <button type="submit" className="submit-button">Submit Booking</button>
      </form>
    </div>
  );
};

export default BookingPage;
